      <h1>Add a Note</h1>
      <form action='' className='newFolder'>
        <h2 className='folderName'>New Note Name:</h2>
        <input type='text' placeholder='My New Folder' />
        <button type='submit'>Add!</button>
      </form>
    </div>
  );
}
